import React, { Component } from 'react';

export default class NotesLeftSide extends Component {
  render (){
    const style = { border: "1px solid red", padding: "1rem", margin: "1rem"}
    return(
      <div className="NotesLeftSide" style={style}>
        Hello NotesLeftSide!
        <SearchBar />
      </div>
    )
  };
};
